import React from 'react';
import { Button } from 'semantic-ui-react'

export const Welcome = (props) => {
    return (
        <div>
            Welcome to the game of Hangman. Would you like to play?
            <Button>Yes</Button>
            <Button>No</Button>
        </div>
    )
}
